//SPDX-License-Identifier: MIT

pragma solidity ^0.8.6;

// 钱包签名工具
contract MultiSign {

    // 交易结构体
    struct Transaction {
        address destination;
        uint256 value;
        bool executed;
    }
    // 交易ID, 每次添加交易时其值 +1
    uint256 public transactionCount;
    // 交易信息 交易ID => Transaction
    mapping(uint256 => Transaction) public transactions;
    // 确认信息 交易ID => (确认地址 => 是否确认)
    mapping(uint256 => mapping(address => bool)) public confirmations;
    // 记录某地址是否是钱包所有者
    mapping(address => bool) public isOwner;
    // 钱包的所有者地址列表
    address[] public owners;
    // 需要确认的所有者地址数量
    uint256 public required = 1;

    address public admin = address(0);

    bool public isAllAgree = false;

    event TransactionLog(uint256,string);

    constructor() {
        admin = msg.sender;
        // 设置钱包所有者
        owners.push(admin);
        // 设置需要确认的数量
        required = 1;
    }

    modifier onlyOwner() {
        require(admin == msg.sender, "You are not the owner");
        _;
    }

    modifier onlyOwnerList() {
        require(
            isOwner[msg.sender] || admin == msg.sender,
            "You are not the owner"
        );
        _;
    }

    function setOwners(address[] memory _owners, uint256 _required) public onlyOwner {
        require(_required <= owners.length, "required exceed");

        for (uint256 i = 0; i < _owners.length; i++) {
            // map 数组判断是否存在该地址
            if (isOwner[_owners[i]] || _owners[i] == address(0))
                revert("exist owner");
            // 存入map    
            isOwner[_owners[i]] = true;
        }
        owners = _owners;
        required = _required;
    }

    function setRequired(bool isReq) public onlyOwner {
        isAllAgree = isReq; 
    }

    // 提交交易申请
    // destination 交易的目标地址
    // value 交易数量
    function submitTransaction(
        address destination,
        uint256 value
    ) public onlyOwnerList returns (uint256 transactionId) {
        // 确保余额充足
        require(address(this).balance >= value, "value not enough");
        // 添加交易并返回交易ID, 交易ID是自增的，每次成功添加都会自增1
        transactionId = addTransaction(destination, value);
        confirmTransaction(transactionId);
    }

    // 添加交易
    function addTransaction(
        address destination,
        uint256 value
    ) internal returns (uint256 transactionId) {
        transactionId = transactionCount;
        // transactions 记录该笔交易
        transactions[transactionId] = Transaction({
            destination: destination,
            value: value,
            executed: false
        });

        transactionCount += 1;
    }

    // 供其他拥有者确认该笔交易，只有确认了才能执行
    function confirmTransaction(uint256 transactionId) public onlyOwnerList returns(bool execute) {
        // 确保调用者是钱包的拥有者
        require(isOwner[msg.sender], "you are not in owners");
        // 确保交易的目标地址不为空
        require(
            transactions[transactionId].destination != address(0),
            "transaction destination is none"
        );
        // 确认交易还未被确认
        require(!confirmations[transactionId][msg.sender], "you has confirmed");

        // 调用者确认了该笔交易
        confirmations[transactionId][msg.sender] = true;
        // 执行交易
        return isConfirmed(transactionId);
    }

    function findTransaction(uint256 transactionId) public view returns(Transaction memory trans) {

        require(transactions[transactionId].destination != address(0), "not find transaction by Id");
        trans = transactions[transactionId];
    }

    // 执行交易
    function executeTxState(uint256 transactionId) public onlyOwnerList returns(bool) {
        // 确保交易未被执行
        require(!transactions[transactionId].executed,"transactionId has been executed");
        // 已确认足够的数量
        transactions[transactionId].executed = true;
        return true;
    }

    // 判断 owners 中确认的数量是否满足 required
    function isConfirmed(uint256 transactionId) public view returns (bool) {
        uint256 count = 0;
        // 确保交易未被执行
        // transactions[transactionId].executed =false 往下走
        if(transactions[transactionId].executed){
            return false;
        }
        for (uint256 i = 0; i < owners.length; i++) {
            if (confirmations[transactionId][owners[i]]) count += 1;
            // 是否要全部同意？
            if(isAllAgree){
                if (count == owners.length) return true; 
            }else{
                if (count == required) return true; 
            }
        }
        return false;
    }

    function echo() public pure returns(string memory){
       return "Hello World!";
    }
}

